import React, { useCallback, useState } from 'react'
import '../ExamMaster/Topicpage.css'

const Topicpage = () => {

    const Addcolumn=()=>{

        const[tableData,setTableData]=useState([

            <tr>
                <td><input type="number" /></td>
                <td><input type="number" /></td>
                <td><input type="text" /></td>
            </tr>
        ])
            return(
                <tr>
                     <td><input type="number" placeholder='Enter your examid'/></td>
                    <td> <input type="number" placeholder='Enter your Topid Id' /></td>
                    <td><input type="text" placeholder='Enter your Topic Name' /></td>
                </tr>
            )
      }
  return (
            <div row mx-3>
                <div className="col-4"></div>
                <div className='col-4'></div>
            </div>
  )
}

export default Topicpage
